import React from 'react';
import data from '../data.json'
import { Navbar, Nav, Form } from "react-bootstrap";
import Liste from "./Liste/Liste"
import './Home.css'
console.log(data);

const Home = () => {
    return (
        <div>
            <Navbar bg="light" expand="lg">
  <Navbar.Brand href="#home">Tanke in KÃ¶ln</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">


    </Nav>
    <Form inline>
    <Nav.Link href="#link">Liste</Nav.Link>
    <Nav.Link href="#link">Karten</Nav.Link>

    </Form>
  </Navbar.Collapse>
</Navbar>

<header >
<Form className="w-75 ml-5 headerForm">
  <Form.Group controlId="formBasicEmail">

    <Form.Control type="text" placeholder="Bitte geben Sie hier ein Begriff zur Filterung ein" />

  </Form.Group>

</Form>
</header>

<Liste />
        </div>
    );
};

export default Home;
